import React from 'react';
import { Container } from '@material-ui/core';
import Head from 'next/head';

const Quiz = () => {
  return (
    <>
      <Head>
        <link rel="stylesheet" href="/pages/quiz/styles.css" />
      </Head>
      <div className="background">
        <Container>ALO ALO</Container>
      </div>
    </>
  );
};

export default Quiz;
